# Baseline – 1 proměnná

```
## Call:
## lm(formula = barcount ~ pop, data = grid)
## 
## Residuals:
##     Min      1Q  Median      3Q     Max 
## -16.260  -2.817   0.175   1.132  41.342 
## 
## Coefficients:
##               Estimate Std. Error t value Pr(&gt;|t|)    
## (Intercept) -1.415e+00  4.390e-01  -3.224  0.00137 ** 
## pop          1.338e-03  8.953e-05  14.944  &lt; 2e-16 ***
## ---
## Signif. codes:  0 '***' 0.001 '**' 0.01 '*' 0.05 '.' 0.1 ' ' 1
## 
## Residual standard error: 6.083 on 370 degrees of freedom
## Multiple R-squared:  0.3764,	Adjusted R-squared:  0.3747 
## F-statistic: 223.3 on 1 and 370 DF,  p-value: &lt; 2.2e-16
```

--

Na uživení hospody je potřeba: 747 místňáků v okolí 5 kilometrů čtverečných.

```

--

Na uživení hospody je potřeba: buď 1 634 místňáků, nebo 363 hotelových lůžek, v okolí 5 kilometrů čtverečných.
